// \u51FD\u6570\u5F0F\u5B50\u7EC4\u4EF6
function HelloSon(props){
    return (
        <div>
            \u5B50\u7EC4\u4EF61 { props.msg }
        </div>
    )
}

// \u7C7B\u5B50\u7EC4\u4EF6
class HelloClassSon extends React.Component {
    render(){
        return (
            <div>
                <p>\u8FD9\u662F\u7C7B\u7EC4\u4EF6\u4E2D\u7684\u63A5\u6536\u7236\u7EC4\u4EF6\u4F20\u503C\u7684\u65B9\u6CD5 --- { this.props.msg }</p>
            </div>
        )
    }
}

// \u7236\u7EC4\u4EF6
class App extends React.Component {
    state = {
        msg: "\u7236\u4F20\u5B50\u7684\u5B9E\u73B0"
    }

    render(){
        return (
            <>
                <HelloSon msg={ this.state.msg } />
                <HelloClassSon msg={ this.state.msg } />
            </>
        )
    }
}

export default App
