  let sum = 0;
  let ln = s.length;
  for (let i = 0; i < ln; i++) {
    let value = syValues.get(s[i]);
    if (i < ln - 1 && value < syValues.get(s[i + 1])) {
      sum -= value;
    } else {
      sum += value;
    }
  }

