`,paraId:541,tocIndex:81},{value:"\u5982\u679C\u4E0D\u662F\u7C7B\u6570\u7EC4\u5BF9\u8C61\uFF0C\u5C31\u7ED9\u5BF9\u8C61\u6DFB\u52A0\u4E00\u4E2A[Symbol.iterator]\u5C5E\u6027\uFF0C\u5E76\u6307\u5411\u4E00\u4E2A\u8FED\u4EE3\u5668\u5373\u53EF\u3002",paraId:542,tocIndex:81},{value:`//\u65B9\u6CD5\u4E00\uFF1A
var obj = {
    a:1,
    b:2,
    c:3
};

obj[Symbol.iterator] = function(){
	var keys = Object.keys(this);
	var count = 0;
	return {
		next(){
			if(count<keys.length){
				return {value: obj[keys[count++]],done:false};
			}else{
				return {value:undefined,done:true};
			}
		}
	}
};

for(var k of obj){
	console.log(k);
}


// \u65B9\u6CD5\u4E8C
var obj = {
    a:1,
    b:2,
    c:3
};
obj[Symbol.iterator] = function*(){
    var keys = Object.keys(obj);
    for(var k of keys){
        yield [k,obj[k]]
    }
};

for(var [k,v] of obj){
    console.log(k,v);
}
