let handler = {
    get(target,key){
        console.log('\u53D6\u503C');
        let temp = target[key]
        if(typeof temp ==="object"){
            return new Proxy(temp,handler)
        }
        return temp
    },
    set(target,key,value){
        console.log('\u8D4B\u503C');
        target[key]=value
    }
}

function reactive(target){
    return new Proxy(target,handler)
}

let proxy=reactive(obj)
console.log(proxy)
